* Председатель комитета; 
* Вице-председатель; 
* Начальник штаба Армии США; 
* Начальник штаба Военно-воздушных сил США; 
* Глава космических операций США; 
* Начальник военно-морских операций; 
* Комендант морской пехоты США; 
* Начальник бюро национальной гвардии США Комитет был образован Законом о национальной безопасности, который также создал единое министерство обороны США вместо министерств армии и ВМФ. Основная роль членов комитета — являться советниками заместителей министра обороны по ВМФ, ВВС и армии; председатель комитета также является по должности советником Президента, министра обороны, советника по национальной безопасности, а также совета по национальной безопасности. С 1986 года упразднена обязанность Комитета по непосредственному оперативно-тактическому управлению войсками в зоне боевых действий. Оперативно-тактическое командование группировками Вооружённых сил на ТВД передано начальникам оперативных штабов на ТВД, которые получают приказы на боевое применение непосредственно от министра обороны и президента — главнокомандующего ВС США. За КНШ остаются функции оперативно-стратегического планирования, докладов главнокомандующему и министру обороны, организация боевой подготовки и обучения кадров военнослужащих всех родов войск, обеспечение боеготовности группировок ВС США на мировых ТВД. В Британском содружестве существуют аналогичные организации — Комитеты начальников штабов.
